/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { useEffect, useState } from "react";
import { NavLink } from "react-router-dom";
import PC_LogoHeader_Home from "./img/PC_LogoHeader_Home.png";

import Cart_Button_main from "./img/Cart_Button_main.png";

const Header = () => {
  return (
    <>
      <head>
        <meta charSet="UTF-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
        <title>Plankcooking</title>
        <link
          rel="stylesheet"
          href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
        />
        <link rel="stylesheet" type="text/css" href="/plankcooking.css" />
      </head>
      <header>
        <div className="biggerNavView mb-5">
          <div className="header center ">
            <NavLink className="nav-link " to="/">
              <img
                src={PC_LogoHeader_Home}
                alt="logo header"
                className="img-fluid"
              />
            </NavLink>

            <NavLink className="cartPostition" to="/Cart">
              <img
                src={Cart_Button_main}
                alt="cart button"
                className="img-fluid"
              />
            </NavLink>
          </div>
        </div>
      </header>
    </>
  );
};

export default Header;
